import "./App.css";
import { Route, Switch } from "react-router-dom";
import Home from "./views/Home/Home";
import NavBar from "./components/NavBar/NavBar";
import Cards from "./components/Cards/Cards";
import About from "./views/About/About";
import ContactForm from "./components/Form/Form";
import Contact from "./views/Contact/Contact"; // Importa el componente Contact

function App() {
  return (
    <div className="App">
      <NavBar /> {/* Mueve el componente NavBar fuera de la Route */}
      <Switch>
        <Route exact path="/" component={Home} />
        <Route path="/about" component={About} /> {/* Ruta para About */}
        <Route path="/portfolio" component={Cards} /> {/* Ruta para Portfolio */}
        <Route path="/contact" component={Contact} /> {/* Ruta para Contact */}
      </Switch>
    </div>
  );
}

export default App;
